import React, { Component } from "react";
import { Joystick } from "react-joystick-component"

class Teleoperation extends Component {
    state={};


    handMove(){
        console.log("handle move");
    }
    handStop(){
        console.log("handle stop");
    }
    render(){
        return(
            <div>
                <Joystick
                size={100}
                baseColor="#EEEEEE"
                stickColor="#BBBBBB"
                move={this.handMove}
                stop={this.handStop}
                ></Joystick>
            </div>
        )


    }

}

export default Teleoperation;
